import React from "react";
import { Link } from "react-router-dom";
import "../css/Main.css";

const sampleHospital = {
  id: 1,
  name: "Gangnam General Hospital",
  address: "123 Gangnam-daero, Gangnam-gu, Seoul",
  location: "123 Gangnam-daero, Gangnam-gu, Seoul",
  phone: "02-1234-5678",
  Acongestion: 10,
  Pcongestion: 8,
};

const Main = () => {
  return (
    <div className="main-container">
      <Link
        to={{
          pathname: "/DistanceOrder",
          state: { userLocation: "서울특별시 강남구" },
        }}
      >
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="거리순 아이콘" /> 거리순 기준
          선택
        </button>
      </Link>
      <Link to="/CongestionLevelOrder">
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="혼잡도 아이콘" /> 혼잡도 기준
          선택
        </button>
      </Link>
      <Link to="/MapOrder">
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="지도 아이콘" /> 지도 기준 선택
        </button>
      </Link>
      <Link
        to={{
          pathname: "/HInfo",
          state: { hospital: sampleHospital },
        }}
      >
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="병원 정보 아이콘" /> 병원 상세
          정보(테스트)
        </button>
      </Link>
    </div>
  );
};

export default Main;
